INSERT INTO `settings` VALUES ('00d33b2e-23e4-4597-b000-44b08d66f808',1,'Security','trustProxy','0','bool',0,'Enable this setting if Willow CMS is deployed behind a proxy or load balancer that modifies request headers. When enabled, the application will trust the `X-Forwarded-For` and `X-Real-IP` headers to determine the original client IP address. Use this setting with caution, as it can expose Willow CMS to IP spoofing if untrusted proxies are allowed.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('016aa574-6eb8-45c7-bd54-fc85d96ec7fb',7,'Translations','et_EE','0','bool',0,'Enable translations in Estonian',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('0246aeb4-b478-4578-9ef3-9266242d3b1b',11,'Translations','hu_HU','0','bool',0,'Enable translations in Hungarian',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('05ac495b-c7d8-44a2-bcec-ef29897fc5b4',5,'ImageSizes','small','200','numeric',0,'The width for the small image size.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('0817ddf5-cdd1-4a77-a157-47bff0c00570',3,'SEO','siteStrapline','Welcome toAdapter CMS','textarea',0,'The site strapline is a brief, catchy phrase or slogan that complements your site name. It provides additional context or a memorable tagline that encapsulates the essence of your website. This strapline is often displayed alongside the site name in headers or footers.',NULL,4,'2025-07-11 17:43:27','2025-07-11 23:48:12'),('0abe14bb-61c3-4ca2-a504-24372fbeb85e',0,'Anthropic','apiKey','your-api-key-here','text',1,'This field is used to store your Anthropic API key, which grants access to a range of AI-powered features and services provided by Anthropic. These features are designed to enhance your content management system and streamline various tasks. Some of the key functionalities include auto tagging, SEO text generation, image alt text & keyword generation.',NULL,12,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('0e085cbf-b4d5-45f0-917f-7f1fe9f4663d',200,'AI','gallerySEO','0','bool',0,'Enable AI-powered SEO field generation for image galleries.',NULL,2,'2025-07-11 17:43:28','2025-07-11 17:43:28'),('13911e13-30f9-42a2-a0ed-da41cc3e1ec0',21,'Security','suspiciousWindowHours','24','numeric',0,'Time window in hours for counting suspicious requests.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('15315006-c8b8-4851-aa5f-12365db32fee',3,'ImageSizes','large','400','numeric',0,'The width for the large image size.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('15a3d9d7-41df-48a6-bcf0-7147747ce927',1,'Google','tagManagerHead','<!-- Google tag (gtag.js) -->\r\n<script async src=\"https://www.googletagmanager.com/gtag/js?id=G-XXXXXXXXXX\"></script>\r\n<script>\r\n  window.dataLayer = window.dataLayer || [];\r\n  function gtag(){dataLayer.push(arguments);}\r\n  gtag(\'js\', new Date());\r\n  gtag(\'config\', \'G-XXXXXXXXXX\');\r\n</script>','textarea',1,'The Google Tag Manager <head> tag is a JavaScript snippet placed in the <head> section that loads the GTM container and enables tag management without direct code modifications.',NULL,8,'2025-07-11 17:43:27','2025-07-11 20:55:51'),('1628636d-b574-495f-8a80-47b277635b6a',5,'Google','youtubeChannelId','your-api-key-here','text',1,'This field is used to store your YouTube Channel ID, which is required to allow you to filter videos to just your own.',NULL,12,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('1b0ef3ac-2672-4a4d-9baa-4abf9582581f',2,'SitePages','mainMenuShow','selected','select',0,'Should the main menu show all root pages or only selected pages?','{\n  \"root\": \"Top Level Pages\",\n  \"selected\": \"Selected Pages\"\n}',2,'2025-07-11 17:43:27','2025-07-11 20:55:51'),('1c9ed4a3-1a55-4cb5-92df-d7005f227aed',15,'Translations','nl_NL','0','bool',0,'Enable translations in Dutch',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('211ceb8e-1c5b-4db9-90a8-20f8d13d35d8',1,'Translations','bg_BG','0','bool',0,'Enable translations in Bulgarian',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('243ebce2-fb3d-4765-8b5d-3ae92b1d0375',4,'Google','youtubeApiKey','your-api-key-here','text',1,'This field is used to store your YouTube API key, which is required to access your videos to insert into post and page content.',NULL,12,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('27f04250-ff94-4ad1-97be-d427566cbac0',14,'Translations','lv_LV','0','bool',0,'Enable translations in Latvian',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('28127c66-7ed7-4856-9e24-399f52a61182',7,'AI','articleSummaries','0','bool',0,'Automatically generate concise and compelling summaries for your articles and pages. When enabled, the system will analyze the content and create a brief synopsis that captures the key points. These summaries will appear on the article index page and other areas where a short overview is preferable to displaying the full text.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('2902845e-8243-4fed-90c8-77231a98dd8d',6,'ImageSizes','tiny','100','numeric',0,'The width for the tiny image size.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('2c06a06b-1e4d-4e5f-8500-afd2ed1e0af0',9,'Translations','fr_FR','0','bool',0,'Enable translations in French',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('2c25b703-7147-4ad0-8549-4207028d2324',22,'Translations','sl_SI','0','bool',0,'Enable translations in Slovenian',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('2fff2940-a191-4e8a-ae56-3563beb19129',1,'ImageSizes','massive','800','numeric',0,'The width for the massive image size.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('310772bc-6eb0-4da9-a5b2-6d21dd9538b3',15,'RateLimit','passwordResetNumberOfSeconds','300','numeric',0,'Time window in seconds for password reset rate limiting (300 = 5 minutes).',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('345885b6-795f-427e-b512-d2c9d6212d92',1,'SitePages','privacyPolicy','None','select-page',0,'Choose which page to show as your site Privacy Policy.','',2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('34843089-de9e-47e7-ba00-10e389a13406',16,'Translations','no_NO','0','bool',0,'Enable translations in Norwegian',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('39b8c33e-a2e5-459f-9fc5-37ada6d54a19',13,'RateLimit','adminNumberOfSeconds','60','numeric',0,'Time window in seconds for admin area rate limiting.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('3aa283eb-b374-462b-a082-17796ea4c1aa',1,'AI','enabled','0','bool',0,'Harness the power of artificial intelligence to enhance your content creation process. By enabling AI features, you gain access to a range of powerful tools, such as automatic article summarization, SEO metadata generation, and multilingual translation.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('3f590f73-60b1-4c9a-a7be-5651357ee7de',3,'AI','tagTranslations','0','bool',0,'Automatically translate your tags into any of the 25 languages enabled in the translations settings. When you publish a page or article, the system will generate high-quality translations.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('41ce4651-5f8d-443a-b42d-388af94dcca5',4,'Security','enableRateLimiting','1','bool',0,'Enable rate limiting for IP addresses. When enabled, the system will track request frequency and temporarily block IPs that exceed the configured limits.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('42325ea1-a6b2-47d1-94e9-20ac5e850e43',1,'Users','registrationEnabled','1','bool',0,'Turn this on to enable users to register accounts on the site.',NULL,2,'2025-07-11 17:43:27','2025-07-11 20:55:54'),('42c1ba19-fb98-41fd-8940-a8d27c8e2944',4,'Translations','de_DE','0','bool',0,'Enable translations in German',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('456fedee-eee1-4f0b-b91c-b997684df0bf',2,'Translations','cs_CZ','0','bool',0,'Enable translations in Czech',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('4e290510-0cc8-4d62-bcf2-43f0f4f27c24',0,'Blog','articleDisplayMode','summary','select',0,'This setting controls if articles on the blog index show their Summary or Body text.','{\n  \"summary\": \"Summary\",\n  \"lede\": \"Lede\",\n  \"body\": \"Body\"\n}',2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('4f435fd6-a276-4039-b4de-6ec2b7303e5b',8,'ImageSizes','micro','10','numeric',0,'The width for the micro image size.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('5022538f-8eb8-4148-8266-94339f7717da',24,'Translations','tr_TR','0','bool',0,'Enable translations in Turkish',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('620f43af-444e-4b26-9963-d1bb3f8bc276',4,'SEO','robots','User-agent: *\r\nAllow: /{LANG}/\r\nAllow: /{LANG}/articles/*\r\nAllow: /{LANG}/pages/*\r\nAllow: /{LANG}/sitemap.xml\r\n\r\nDisallow: /admin/\r\nDisallow: /{LANG}/users/login\r\nDisallow: /{LANG}/users/register\r\nDisallow: /{LANG}/users/forgot-password\r\nDisallow: /{LANG}/users/reset-password/*\r\nDisallow: /{LANG}/users/confirm-email/*\r\nDisallow: /{LANG}/users/edit/*\r\nDisallow: /{LANG}/cookie-consents/edit\r\n\r\n# Prevent indexing of non-existent listing pages\r\nDisallow: /{LANG}/articles$\r\nDisallow: /{LANG}/pages$\r\n\r\nSitemap: /{LANG}/sitemap.xml','textarea',0,'The template for robots.txt file. Use {LANG} as a placeholder for the language code. This template will be used to generate the robots.txt file content.',NULL,4,'2025-07-11 17:43:27','2025-07-11 20:55:51'),('6def1136-b6bc-47d9-b01a-291071d6a551',4,'AI','articleSEO','0','bool',0,'Optimize your articles and pages for search engines and social media by automatically generating SEO metadata. When enabled, the system will create a meta title, meta description, meta keywords, and tailored descriptions for Facebook, LinkedIn, Instagram, and Twitter.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('7011444a-90e9-4e88-b894-09b2d7bea766',5,'AI','tagSEO','0','bool',0,'Optimize your tags for search engines and social media by automatically generating SEO metadata. When enabled, the system will create a meta title, meta description, meta keywords, and tailored descriptions for Facebook, LinkedIn, Instagram, and Twitter.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('738dbab2-2229-4af4-9eaa-5c2e46f41e3a',8,'AI','imageAnalysis','0','bool',0,'Enable or disable the automatic image analysis feature to enhance your content\'s accessibility. When activated, the system will examine each images to generate relevant keywords and descriptive alt text. This functionality ensures that images are appropriately tagged, improving SEO and providing a better experience for users who rely on screen readers.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('74a30aaa-2c63-483b-ad8b-cbc2c4f25e05',14,'RateLimit','passwordResetNumberOfRequests','3','numeric',0,'Maximum password reset requests allowed within the time window.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('77d0b99c-0d14-493d-a9f4-68153570109f',17,'Translations','pl_PL','0','bool',0,'Enable translations in Polish',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('792fac96-9572-470f-8e6d-5af7d2c1396e',3,'SitePages','mainTagMenuShow','selected','select',0,'Should the main tag menu show all root tags or only selected tags?','{\n  \"root\": \"Top Level Tags\",\n  \"selected\": \"Selected Tags\"\n}',2,'2025-07-11 17:43:27','2025-07-11 20:56:45'),('7a4beda0-6c9b-440a-9f94-7296ac831cbe',13,'Translations','lt_LT','0','bool',0,'Enable translations in Lithuanian',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('7aba4bba-5a0a-442c-83aa-6bd855968477',2,'Comments','pagesEnabled','1','bool',0,'Turn this on to enable logged in users to comment on your pages.',NULL,2,'2025-07-11 17:43:27','2025-07-11 20:56:45'),('7d5b1ee2-abe5-4cb0-a47d-4fef0fe88302',16,'RateLimit','registerNumberOfRequests','5','numeric',0,'Maximum registration requests allowed within the time window.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('7f3e89c3-c3a4-48f2-9d56-64d9d2961a34',8,'Translations','fi_FI','0','bool',0,'Enable translations in Finnish',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('7f978914-1fc4-4d4d-a925-2eaf1a962f8d',17,'RateLimit','registerNumberOfSeconds','300','numeric',0,'Time window in seconds for registration rate limiting (300 = 5 minutes).',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('87d3a00b-386e-4cda-9640-60d6fba24fe6',0,'PagesAndArticles','additionalImages','1','bool',0,'Enable additional image uploads on your Articles and Pages.',NULL,2,'2025-07-11 17:43:27','2025-07-11 23:48:12'),('89e28225-7a1b-495d-b4db-8f1c2ab6b05f',3,'Google','translateApiKey','your-api-key-here','text',1,'This field is used to store your Google API key, which is required to access and utilize the Google Cloud Translation API. The Google Cloud Translation API allows you to integrate machine translation capabilities into your content management system, enabling automatic translation of your website content into different languages.',NULL,12,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('8b8c0c8f-1920-4586-b834-396369c88e00',1,'Comments','articlesEnabled','1','bool',0,'Turn this on to enable logged in users to comment on your articles.',NULL,2,'2025-07-11 17:43:27','2025-07-11 20:56:45'),('8cf56568-ba00-487c-998f-4c2284e4b31b',20,'Translations','ru_RU','0','bool',0,'Enable translations in Russian',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('90a9c746-3d5b-4408-b551-72a5091a3586',12,'RateLimit','adminNumberOfRequests','40','numeric',0,'Maximum admin area requests allowed within the time window.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('90c6bf9b-092d-469c-91b5-cc8ab40fd7ff',25,'Translations','uk_UA','0','bool',0,'Enable translations in Ukrainian',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('95226084-1770-4d8f-9cf2-5b6357165c1a',10,'Translations','hr_HR','0','bool',0,'Enable translations in Croatian',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('997f03ec-e450-431f-9cae-cec3e7037380',0,'i18n','locale','en_GB','select',0,'This setting determi