ives an email from your website and chooses to reply to it, their response will be directed to the email address specified in this field.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('b4eb69f1-55ad-42fd-84d3-e8bd53ef529f',22,'Security','suspiciousBlockHours','24','numeric',0,'How long to block IPs that exceed the suspicious request threshold (in hours).',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('b5692644-600b-437e-80e1-c45df44f8c14',10,'RateLimit','loginNumberOfRequests','5','numeric',0,'Maximum login attempts allowed within the time window.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('b711def5-ccac-4b0a-b68a-dd1345273e19',3,'Translations','da_DK','0','bool',0,'Enable translations in Danish',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('b8071331-476c-4412-9a1a-f1ccb3d16161',23,'Translations','sv_SE','0','bool',0,'Enable translations in Swedish',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('ba3aa8a6-cd3f-4a17-b2ed-561ac832ea8f',11,'RateLimit','loginNumberOfSeconds','60','numeric',0,'Time window in seconds for login rate limiting.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('ba4e8608-d20c-402a-a4d5-3cd266e99012',2,'AI','articleTranslations','0','bool',0,'Automatically translate your articles into any of the 25 languages enabled in the translations settings. When you publish a page or article, the system will generate high-quality translations.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('bf848817-5f7e-44ec-94c6-2080333d2e55',201,'AI','galleryTranslations','0','bool',0,'Enable automatic translation of image galleries to all enabled languages.',NULL,2,'2025-07-11 17:43:28','2025-07-11 17:43:28'),('bf9d1079-12f8-4822-9c96-51db4e3f7a08',6,'Translations','es_ES','0','bool',0,'Enable translations in Spanish',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('c2141fdf-4c65-439c-92e4-66535a31e58c',6,'SEO','siteName','Adapter CMS','text',0,'This field represents the official name of your website. It is typically displayed in the title bar of web browsers and is used in various places throughout the site to identify your brand or organization. Ensure that the name is concise and accurately reflects the purpose or identity of your site.',NULL,4,'2025-07-11 17:43:27','2025-07-11 23:28:46'),('c6841fa5-8444-4465-a75a-e752659bd656',1,'SEO','siteMetakeywords','Default site meta keywords','textarea',0,'Metakeywords are a set of keywords or phrases that describe the content of your website. These keywords are used by search engines to index your site and improve its visibility in search results. Enter relevant and specific keywords that accurately represent the topics and themes of your site content.',NULL,4,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('c6c7ddde-9d32-445b-95d6-7c6e4debc390',2,'Security','trustedProxies','*','textarea',0,'List of trusted proxy IP addresses (one per line). Only requests from these IPs will have their forwarded headers honored when trustProxy is enabled. Leave empty to trust all proxies (not recommended for production).',NULL,6,'2025-07-11 17:43:27','2025-07-11 20:56:11'),('cc6d7bc6-578d-46dc-9473-f9cd4ab56b18',2,'ImageSizes','extraLarge','500','numeric',0,'The width for the extra-large image size.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('d1eaa4bf-3b74-452b-a32a-80220053c3f9',21,'Translations','sk_SK','0','bool',0,'Enable translations in Slovak',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('d2294bd4-1d08-45c6-8bfa-7fa9aa0e4010',2,'SEO','siteMetaDescription','Default site meta description','textarea',0,'The site meta description is a brief summary of your website\'s content and purpose. It appears in search engine results below the page title and URL, providing potential visitors with a snapshot of what your site offers. Craft a compelling and informative description to encourage clicks and improve search engine optimization (SEO).',NULL,4,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('d326652a-8291-4a89-b0a8-20203efaf6ea',0,'i18n','provider','anthropic','select',0,'This setting is used for updating the built-in translations for the Willow CMS interface. Options include Google or Anthropic, with Google generally providing better translations. For auto translation of your website content, see the Translations section to enable languages.','{\n  \"google\": \"Google\",\n  \"anthropic\": \"Anthropic\"\n}',2,'2025-07-11 17:43:27','2025-07-12 00:47:23'),('dd4f8997-f782-4404-8ebe-cd4f591b5671',5,'Translations','el_GR','0','bool',0,'Enable translations in Greek',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('de1856b4-c7be-401b-b118-a4bcd9cb460d',1,'RateLimit','numberOfSeconds','60','numeric',0,'This field complements the \"Rate Limit: Number Of Requests\" setting by specifying the time window in which the request limit is enforced. It determines the duration, in seconds, for which the rate limit is applied. For example, if you set the \"Rate Limit: Number Of Requests\" to 100 and the \"Rate Limit: Number Of Seconds\" to 60, it means that an IP address can make a maximum of 100 requests within a 60-second window. If an IP address exceeds this limit within the specified time frame, they will be blocked for a certain period to prevent further requests and protect your server from potential abuse or overload.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('f376dacc-b132-4edc-9646-0a0be99df5e4',20,'Security','suspiciousRequestThreshold','3','numeric',0,'Number of suspicious requests before blocking an IP.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('f456263e-8eb6-4b56-a3ce-53b4862c93fa',0,'Editing','editor','markdownit','select',0,'Chose your default editor for posts and pages content. Trumbowyg is good for HTML whilst Markdown-It supports Markdown.','{\n  \"trumbowyg\": \"Trumbowyg\",\n  \"markdownit\": \"Markdown-It\"\n}',2,'2025-07-11 17:43:27','2025-07-12 00:47:23'),('f817fdae-34b5-485f-9d25-da21a98152b3',19,'Translations','ro_RO','0','bool',0,'Enable translations in Romanian',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('f8a78b39-5c8a-4cc6-ba36-30430cded8a6',18,'Translations','pt_PT','0','bool',0,'Enable translations in Portuguese',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('fb2424f9-31fd-401e-adec-3e8196e7eff5',6,'AI','articleTags','0','bool',0,'Automatically generate relevant tags for your articles and pages based on their content. When you save an article or page, the system will analyze the text and create tags that best represent the main topics and keywords. These tags will then be automatically linked to the corresponding article or page, making it easier for readers to find related content on your website.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27'),('fc7a988f-5aae-4f40-8ee3-cb7a47693b3a',4,'ImageSizes','medium','300','numeric',0,'The width for the medium image size.',NULL,2,'2025-07-11 17:43:27','2025-07-11 17:43:27');
